const CvNavigation = () => {
  return (
    <nav className="font-urbanist flex justify-end px-8">
      <ul className=" list-none flex flex-row gap-8">
        <li className=" cursor-pointer ease-in-out duration-300 hover:scale-105 font-bold">About</li>
        <li className=" cursor-pointer ease-in-out duration-300 hover:scale-105 font-bold">Porfolio</li>
        <li className=" cursor-pointer ease-in-out duration-300 hover:scale-105 font-bold">Contact</li>
      </ul>
    </nav>
  );
};

export default CvNavigation;
